webpackJsonp([0xf5a978119a56],{415:function(A,a){A.exports={data:{markdownRemark:{html:'<p>It\'s tough to believe that the 4th of July has already come and gone and that I\'ve been at my internship for 5 and 1/2 weeks (?!!).</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="food bank"\n        title=""\n        src="/static/foodbank-48c321a597e04fedd72abdba4166bbf7-631b1.jpg"\n        srcset="/static/foodbank-48c321a597e04fedd72abdba4166bbf7-30fbd.jpg 200w,\n/static/foodbank-48c321a597e04fedd72abdba4166bbf7-e87dc.jpg 400w,\n/static/foodbank-48c321a597e04fedd72abdba4166bbf7-631b1.jpg 800w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Volunteering at the <a href="https://www.sfmfoodbank.org/">SF Marin Food Bank</a></h4>\n<p>Last week flew by. It was a great week, but the trip to Lake Tahoe with my lovely roommates was easily the highlight.</p>\n<h2>Tahoe</h2>\n<p>On Friday we (the majority of my roommates and I) rushed home from work to pack, which in my case means tossing a random amount of clothing into a backpack and hoping for the best.  We promptly packed ourselves, along with a few days worth of food into a rented 15 person van.</p>\n<p>The drive down took us about 5 hours due to holiday traffic and a stop at In-N-Out.  It was my first time at an In-N-Out and personally I\'d say it lived up to the hype.</p>\n<p></p>\n<p>By the time we arrived at our <a href="https://www.booking.com/hotel/us/wildwood-tahoe-vista-lodge-tahoe-vista.html#tab-main">rented cabin</a>, most of us (especially me) were ready to pass out.  I found a place to sleep and passed out almost immediately.</p>\n<p>The next morning I got up early and mixed up a 4x batch of Smitten Kitchen\'s <a href="https://smittenkitchen.com/2013/10/lazy-pizza-dough-favorite-margarita-pizza/">Lazy Pizza Dough</a> before anyone else was up.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cabin"\n        title=""\n        src="/static/cabin-1c9b81824855a4b553bbdb349edc3d19-631b1.jpg"\n        srcset="/static/cabin-1c9b81824855a4b553bbdb349edc3d19-30fbd.jpg 200w,\n/static/cabin-1c9b81824855a4b553bbdb349edc3d19-e87dc.jpg 400w,\n/static/cabin-1c9b81824855a4b553bbdb349edc3d19-631b1.jpg 800w,\n/static/cabin-1c9b81824855a4b553bbdb349edc3d19-7e1a3.jpg 1024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Sitting on our porch, journaling and dazing off into the woods made me realize how key it is to get out of the city once in awhile.  I love living in the city. But, at least for me there is something absolutely essential and rejuvenating about spending time in nature, not surrounded by millions of other humans.</p>\n<p>Before long, a crew of people were awake.  We made plans, grabbed a quick breakfast and were on our way to hike the <a href="https://www.alltrails.com/trail/us/nevada/tahoe-rim-trail-trt-tahoe-meadows-to-twin-lakes">Tahoe Rim Trail</a>.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Tahoe Rim Trail"\n        title=""\n        src="/static/view-9c26becc24b0fea06deca4f08cb08774-631b1.jpg"\n        srcset="/static/view-9c26becc24b0fea06deca4f08cb08774-30fbd.jpg 200w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-e87dc.jpg 400w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-631b1.jpg 800w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-300e3.jpg 1200w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-c15ef.jpg 1600w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-3a622.jpg 2400w,\n/static/view-9c26becc24b0fea06deca4f08cb08774-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Overlook on the Tahoe Rim Trail</h4>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="selfie"\n        title=""\n        src="/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-631b1.jpg"\n        srcset="/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-30fbd.jpg 200w,\n/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-e87dc.jpg 400w,\n/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-631b1.jpg 800w,\n/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-300e3.jpg 1200w,\n/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-c15ef.jpg 1600w,\n/static/selfie-cd0b4b55d1f7fbeea2dca536764e35e0-e49fc.jpg 1944w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>We really had no idea where we were going when we started, but ended up making it to twin lakes, a surprisingly empty clearing in the woods with only one lake (still not quite sure how it got it\'s name).</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.49122807017545%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hiking"\n        title=""\n        src="/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-631b1.jpg"\n        srcset="/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-30fbd.jpg 200w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-e87dc.jpg 400w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-631b1.jpg 800w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-300e3.jpg 1200w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-c15ef.jpg 1600w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-3a622.jpg 2400w,\n/static/hiking-7590d6cc4bc2889c4fb6c637296f32d4-56ee3.jpg 2850w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hand stand at twin lakes"\n        title=""\n        src="/static/handstand-7d56481b601ce5ace11d1ae77ab67221-631b1.jpg"\n        srcset="/static/handstand-7d56481b601ce5ace11d1ae77ab67221-30fbd.jpg 200w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-e87dc.jpg 400w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-631b1.jpg 800w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-300e3.jpg 1200w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-c15ef.jpg 1600w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-3a622.jpg 2400w,\n/static/handstand-7d56481b601ce5ace11d1ae77ab67221-aeab9.jpg 4032w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Twin Lakes Celebratory Handstand</h4>\n<p>The hike was about 8 miles round trip with some pretty steep hills on the way up.  Needless to say we were feeling pretty accomplished and had worked up quite the appetite by the time we got back to where we started.</p>\n<p>Luckily <a href="http://tunnelcreekcafe.com/">Tunnel Creek Cafe</a> was waiting for us at the bottom.  Their turkey pesto panini definitely earned my personal recommendation.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.223958333333336%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Friends"\n        title=""\n        src="/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-631b1.jpg"\n        srcset="/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-30fbd.jpg 200w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-e87dc.jpg 400w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-631b1.jpg 800w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-300e3.jpg 1200w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-c15ef.jpg 1600w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-3a622.jpg 2400w,\n/static/hike_crew-eb7dac23d9ebe60fca93725566486ce1-e8941.jpg 3840w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="More Friends"\n        title=""\n        src="/static/hike_friends-634e2978be982a085ed2959c2afb575e-631b1.jpg"\n        srcset="/static/hike_friends-634e2978be982a085ed2959c2afb575e-30fbd.jpg 200w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-e87dc.jpg 400w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-631b1.jpg 800w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-300e3.jpg 1200w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-c15ef.jpg 1600w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-3a622.jpg 2400w,\n/static/hike_friends-634e2978be982a085ed2959c2afb575e-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Our five sweaty bodies piled into an Uber and headed back to the cabin to meet up with the rest of the group.</p>\n<p>I swear every time I take an Uber, my mind is still blown away by the fact that it works.  It sounds silly to say that, but it really is kind of incredible.</p>\n<p>Lake Tahoe Fun Facts (provided by our Uber driver):</p>\n<ul>\n<li>It is the 2nd largest alpine lake in the world</li>\n<li>At 9 feet deep and below, the temperature is a constant 33 °F</li>\n<li>The maximum depth was measured at 1645 ft</li>\n</ul>\n<p>Back at the cabin we changed into swimsuits, caked on as much sunscreen as we could bear, and climbed back in the van to head to <a href="http://parks.nv.gov/parks/lake-tahoe-nevada-state-park">Sand Harbor</a>.  I\'ll let the pictures speak for themselves here.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rocks and people"\n        title=""\n        src="/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-631b1.jpg"\n        srcset="/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-30fbd.jpg 200w,\n/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-e87dc.jpg 400w,\n/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-631b1.jpg 800w,\n/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-300e3.jpg 1200w,\n/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-c15ef.jpg 1600w,\n/static/rock_crew-d7d4a34ccca128964ffab85fc28b84b9-d8555.jpg 2048w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rocks"\n        title=""\n        src="/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-631b1.jpg"\n        srcset="/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-30fbd.jpg 200w,\n/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-e87dc.jpg 400w,\n/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-631b1.jpg 800w,\n/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-300e3.jpg 1200w,\n/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-c15ef.jpg 1600w,\n/static/rocks-90585f7a4b13e36ee370f2e60ad247aa-d8555.jpg 2048w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The night came to a close with pizza, champagne, and most of us passed out before midnight after a long day.  The next morning we snuck in a few more hours lounging and kayaking at King\'s Beach before starting the long drive home.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="pizza"\n        title=""\n        src="/static/pizza-24df89c7203f9271327e7318b571806c-631b1.jpg"\n        srcset="/static/pizza-24df89c7203f9271327e7318b571806c-30fbd.jpg 200w,\n/static/pizza-24df89c7203f9271327e7318b571806c-e87dc.jpg 400w,\n/static/pizza-24df89c7203f9271327e7318b571806c-631b1.jpg 800w,\n/static/pizza-24df89c7203f9271327e7318b571806c-300e3.jpg 1200w,\n/static/pizza-24df89c7203f9271327e7318b571806c-c15ef.jpg 1600w,\n/static/pizza-24df89c7203f9271327e7318b571806c-3a622.jpg 2400w,\n/static/pizza-24df89c7203f9271327e7318b571806c-2d991.jpg 3024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Smitten Kitchen never disappoints</h4>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.21458209839952%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="everyone"\n        title=""\n        src="/static/everyone-e7f1da0f81c2194dabd9f8823231c223-631b1.jpeg"\n        srcset="/static/everyone-e7f1da0f81c2194dabd9f8823231c223-30fbd.jpeg 200w,\n/static/everyone-e7f1da0f81c2194dabd9f8823231c223-e87dc.jpeg 400w,\n/static/everyone-e7f1da0f81c2194dabd9f8823231c223-631b1.jpeg 800w,\n/static/everyone-e7f1da0f81c2194dabd9f8823231c223-300e3.jpeg 1200w,\n/static/everyone-e7f1da0f81c2194dabd9f8823231c223-c15ef.jpeg 1600w,\n/static/everyone-e7f1da0f81c2194dabd9f8823231c223-546f8.jpeg 1687w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>I don\'t live with ALL of these people....just most of them.</h4>\n<p>I am so thankful to have had the chance to go on this trip and I can only hope I\'ll be back sometime in the nearish future.</p>\n<p>Thank you so much to everyone who helped plan the trip and make it happen, as well as all of the wonderful people that came and made the trip special.</p>\n<hr>\n<p>That\'s all for today.  I hope you enjoyed the slightly less serious, more picture heavy post.  I\'ll be back with a weekly update on Sunday.</p>',frontmatter:{path:"/interning-in-sf-week-5",title:"Roadtripping to LAKE TAHOE",date:"07-05-2017",tag:"Travel"}}},pathContext:{}}}});
//# sourceMappingURL=path---interning-in-sf-week-5-3ba01e428f96b6dfefe9.js.map